import React from 'react';
import { Link } from 'react-router-dom';
import AdminLogo from '../../../../assets/images/logo-large.svg';

const HeaderPage = () => {
    return (
        <div className="header-page">
            <Link to="/">
                <img src={AdminLogo} alt="" className="not-found-image-admin" />
            </Link>
        </div>
    );
};

export default HeaderPage;
